package com.ruoyi.his.remote.response.healthcard;

import java.io.Serializable;

/**
 * Created by ASUS on 2019/1/25.
 */
public class DynamicQRCodeResponse implements Serializable {

    /**
     * ext :
     * qrCodeImg : 
     * color : 0
     * qrCodeText : B5A28173356BB199962ABE0493ED0416CC17A9DF801CBE416B08CAB5A97D4AB6:0:521666C5CB4A25B1EC1CD66CACD28191:4400A0062FWHB0187
     */

    private String ext;
    private String qrCodeImg;
    private int color;
    private String qrCodeText;

    public String getExt() {
        return ext;
    }

    public void setExt(String ext) {
        this.ext = ext;
    }

    public String getQrCodeImg() {
        return qrCodeImg;
    }

    public void setQrCodeImg(String qrCodeImg) {
        this.qrCodeImg = qrCodeImg;
    }

    public int getColor() {
        return color;
    }

    public void setColor(int color) {
        this.color = color;
    }

    public String getQrCodeText() {
        return qrCodeText;
    }

    public void setQrCodeText(String qrCodeText) {
        this.qrCodeText = qrCodeText;
    }
}
